function addTitleToCodeBlocks(){const a=document.getElementsByClassName("highlight");for(let b=0;b<a.length;b++)try{if(a[b].title.length){let c=document.createElement("div");if(a[b].getElementsByClassName("code-title").length)continue;c.textContent=a[b].title,c.classList.add("code-title"),a[b].insertBefore(c,a[b].firstChild)}}catch(a){console.debug(a)}}